import React, { Component, useEffect } from 'react'
import { useParams } from 'react-router-dom';

const User = () => {
    const { userHandle } = useParams();

    useEffect(() => {
        console.log("Hello");
    })

    return (
        <div>
            Hello, { userHandle }
        </div>
    )
}

export default User;
